{"cells":[{"source":"<a href=\"https://www.kaggle.com/evgenevgen/bike-share-company-data-analysis-gdac-cs1?scriptVersionId=90095429\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"cfa03fd4","metadata":{"papermill":{"duration":0.238958,"end_time":"2022-03-14T16:48:07.02845","exception":false,"start_time":"2022-03-14T16:48:06.789492","status":"completed"},"tags":[]},"source":["# Case Study: How Does a Bike-Share Navigate Speedy Success?\n"]},{"cell_type":"markdown","id":"4ed5e0ef","metadata":{"papermill":{"duration":0.234926,"end_time":"2022-03-14T16:48:07.502292","exception":false,"start_time":"2022-03-14T16:48:07.267366","status":"completed"},"tags":[]},"source":["**Note**: This is a Google data analytics certificate case study."]},{"cell_type":"markdown","id":"2deabf8b","metadata":{"papermill":{"duration":0.240942,"end_time":"2022-03-14T16:48:07.978938","exception":false,"start_time":"2022-03-14T16:48:07.737996","status":"completed"},"tags":[]},"source":["## Scenario\n","According to the scenario, I'm a junior data analyst in the marketing team at Cyclistic, a bike-share company from Chicago.  \n","Cyclistics has a flexible pricing plans: single-ride passes, full-day passes and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members. Also, we know that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.  \n","The finance team have concluded that annual members are much more profitable than casual riders. The management believes the company can increase profits by maximizing the number of annual memberships.  \n","Therefore, I have to understand how casual riders and annual members use Cyclistic bikes differently and how we can convert casual riders into annual members by a new marketing strategy. To do this, I'll analyze the Cyclistic historical bike trip data."]},{"cell_type":"markdown","id":"5f89d42b","metadata":{"papermill":{"duration":0.23494,"end_time":"2022-03-14T16:48:08.451509","exception":false,"start_time":"2022-03-14T16:48:08.216569","status":"completed"},"tags":[]},"source":["# PART 1 - ASK\n","### **1. What is the main task?**  \n","* To identify how casual customers and members use bikes differently.\n","* To figure out why would casual riders buy Cyclistic annual memberships.\n","* To suggest recommendations on how to convert casual customers to members.  \n","  \n","### **2. Who are the key stakeholders?**\n","* Lily Moreno: The director of marketing and my manager.\n","* Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","* Cyclistic marketing analytics team."]},{"cell_type":"markdown","id":"947f0a1f","metadata":{"papermill":{"duration":0.243587,"end_time":"2022-03-14T16:48:08.931748","exception":false,"start_time":"2022-03-14T16:48:08.688161","status":"completed"},"tags":[]},"source":["# PART 2, 3 - PREPARE, PROCESS  \n","### **1. Where is the data?**  \n","* I will use the previous 12 months (**from october 2020 to september 2021**) of Cyclistic trip data from [here](https://divvy-tripdata.s3.amazonaws.com/index.html).\n","  \n","  (Note: The datasets have a different name because Cyclistic is a fictional company.)  \n","\n","### **2. How is the data organized?** \n","* 12 .csv files with 13 columns each.  \n","\n","### **3. Is the data ROCCC?**  \n","* **R**eliable - yes (without bias).\n","* **O**riginal - yes. The data has been made available by Motivate International Inc. under this [license](https://www.divvybikes.com/data-license-agreement).\n","* **C**omprehensive - not exactly (no info about customers, financial info; some empty and NA values, duplicates). \n","* **C**urrent - yes, updated monthly.\n","* **C**ited - yes.  "]},{"cell_type":"markdown","id":"332ecbab","metadata":{"papermill":{"duration":0.235492,"end_time":"2022-03-14T16:48:09.414793","exception":false,"start_time":"2022-03-14T16:48:09.179301","status":"completed"},"tags":[]},"source":["### **4. What tools to choose and why?**\n","* I'll choose R because it's possible to clean, transform, analyze and visualize large datasets right in RStudio."]},{"cell_type":"code","execution_count":1,"id":"8c64bf2c","metadata":{"execution":{"iopub.execute_input":"2022-03-14T16:48:09.896595Z","iopub.status.busy":"2022-03-14T16:48:09.893143Z","iopub.status.idle":"2022-03-14T16:48:11.561367Z","shell.execute_reply":"2022-03-14T16:48:11.559824Z"},"papermill":{"duration":1.909262,"end_time":"2022-03-14T16:48:11.561598","exception":false,"start_time":"2022-03-14T16:48:09.652336","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following ob